CREATE TABLE public.bildoj (
    kapvorto TEXT NOT NULL,
    vorto TEXT NOT NULL,
    "reteja_adreso" TEXT NOT NULL,
    kredito TEXT NULL,

    CONSTRAINT pk_bildoj PRIMARY KEY (kapvorto, vorto),
    CONSTRAINT fk_bildoj_vorto FOREIGN KEY (kapvorto, vorto) REFERENCES public.difinoj (kapvorto, vorto)
);

